import React from 'react';

class PetNamesResultComponent extends React.Component{
    constructor(props){
        super(props);

        this.state = {
            urlBase: baseURL,
            openAIresponse: {
                names: [],
                specie: "",
            },
            petNames: [],
            specie: '',
        }
    }

    render(){
        const renderResponse = () => {
            if(this.state.specie !== ''){
                const res = (
                <ul>
                    <li>Specie: {this.state.specie}</li>
                </ul>
                );
                return res;
            }
            else
            {
                return <p>There are no names for this specie</p>
            }
        }
        return(
            <div className="result-pet-names">
                {renderResponse()}
            </div>
        )
    }
}

export default PetNamesResultComponent;
